    "\d10FFFF",  # <not a character>
    ]
    test_data.each do |string|
      assert @validator.valid_encoding?(string), "U10_NamesList: #{string}"
      assert string.force_encoding("UTF-8").valid_encoding?, "U10_NamesList: #{string}" if @vercheck
    end
  end

end
